import React from 'react';
import { useNavigate } from 'react-router-dom';

function MainPage() {
  const navigate = useNavigate();

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Welcome to AQBA</h1>
      <div style={styles.buttonContainer}>
        <button style={styles.button} onClick={() => navigate('/admin/login')}>
          Admin Login
        </button>
        <button style={styles.button} onClick={() => navigate('/employee/login')}>
          Employee Login
        </button>
        <button style={styles.button} onClick={() => navigate('/trainer/login')}>
          Trainer Login
        </button>
      </div>
    </div>
  );
}

const styles = {
  container: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    height: '100vh',
    backgroundColor: '#f4f6f9',
  },
  title: {
    fontSize: '2.5rem',
    color: '#34495e',
    marginBottom: '2rem',
  },
  buttonContainer: {
    display: 'flex',
    flexDirection: 'column',
    gap: '20px',
  },
  button: {
    width: '200px',
    padding: '10px 20px',
    fontSize: '1.2rem',
    backgroundColor: '#2c3e50',
    color: 'white',
    border: 'none',
    cursor: 'pointer',
    borderRadius: '5px',
  },
};

export default MainPage;
